import Qs from "qs";
import { getTimeDate } from "@/utils/index.js";
import OrderInfo from "./orderinfodialog";
export default {
  components: {
    OrderInfo: OrderInfo
  },
  filters: {
    orderFilter: function orderFilter(status) {
      var statusMap = {
        1: "info",
        2: "warning",
        3: "danger",
        4: "primary",
        5: "success",
        6: "success",
        100: "success"
      }; // 3：待付款，5：已付款，6：已发货，100：交易完成

      return statusMap[status];
    },
    statusFilter: function statusFilter(status) {
      var statusMap = {
        1: "info",
        2: "warning",
        3: "danger",
        4: "primary",
        5: "success",
        6: "success",
        100: "danger"
      }; // 1 待结算 2 已结算 3 余额不足 4 结算异常，等待重试 5 货到付款

      return statusMap[status];
    }
  },
  computed: {
    getbalance: function getbalance() {
      var userinfo = this.$store.state.userinfo;
      return userinfo.balance;
    }
  },
  data: function data() {
    return {
      currentPage: 1,
      pageSize: 5,
      total: 0,
      selectTaskData: {},
      dialogTableVisible: false,
      list: null,
      listLoading: false,
      form: {
        // progress: "",
        // name: "",
        // starttime: "",
        endtime: "",
        mobile: "",
        _uiName_: "eleme"
      }
    };
  },
  created: function created() {
    this.fetchData();
  },
  methods: {
    getOrdername: function getOrdername(type) {
      var statusMap = {
        3: "待付款",
        5: "已付款",
        6: "已发货",
        100: "交易完成"
      };
      return statusMap[type];
    },
    getSettlename: function getSettlename(type) {
      var statusMap = {
        1: "待付款",
        2: "已结算",
        3: "余额不足",
        4: "结算异常，等待重试",
        5: "货到付款"
      };
      return statusMap[type];
    },
    formatTime: function formatTime(row, column, cellValue) {
      return getTimeDate(cellValue);
    },
    onSubmit: function onSubmit() {
      this.fetchData();
    },
    onCancel: function onCancel() {
      this.form.starttime = "";
      this.form.endtime = "";
    },
    fetchData: function fetchData() {
      var _this = this;

      if (this.form.mobile.length != 11) return;
      var page = {
        pageNumber: this.currentPage,
        pageSize: this.pageSize
      };
      this.form["_pagination"] = JSON.stringify(page);
      this.listLoading = true;
      this.axios.get(this.urls.allorderlist + "?" + Qs.stringify(this.form)).then(function (response) {
        _this.list = response.data.list;
        _this.total = response.data.total;
        _this.listLoading = false;
      });
    },
    operationHandle: function operationHandle(index, row, type) {
      var param = {
        orderId: row.id,
        userId: this.$store.state.userinfo.id
      };

      switch (type) {
        case 1:
          this.operationRemote(this.urls.orderapproval, param); //通过

          break;

        case 2:
          this.operationRemote(this.urls.orderreject, param); //拒绝

          break;

        case 3:
          this.operationRemote(this.urls.orderlist, param); //返本金 TODO

          break;

        case 4:
          this.operationRemote(this.urls.ordersuccress, param); //交易完成

          break;

        case 5:
          this.operationRemote(this.urls.orderlist, param); //详情 TODO

          break;

        default:
          break;
      }
    },
    operationRemote: function operationRemote(url, param) {
      var _this2 = this;

      this.axios.post(url + "?" + Qs.stringify(param)).then(function (response) {
        _this2.fetchData();
      });
    },
    lookinfo: function lookinfo(index, row) {
      this.dialogTableVisible = true;
      this.selectTaskData = row;
    },
    editDialogListener: function editDialogListener(bol) {
      this.dialogTableVisible = bol;
    },
    //查看用户信息
    queryUserinfo: function queryUserinfo(item) {
      console.log(item);
    },
    handleSizeChange: function handleSizeChange(val) {
      this.pageSize = val;
      this.fetchData();
    },
    handleCurrentChange: function handleCurrentChange(val) {
      this.currentPage = val;
      this.fetchData();
    }
  }
};
